@bOg3AAWAfeznwTS いいね～！
寒いツイート大歓迎！
これから暑い季節だしｗ

@0ffice_w0rker でもなんか、書いてから、まだ自分にはこう思える余裕があるだけなのか持って思った。
まぁ本当に余裕が亡くなったら一回離れるもよし、毒はくもよしって思う。
月曜の朝から何の話しとるんじゃ？？？　こういうのは深夜にするべきだ🤪🤪🤪

@otsu83 そうだそうだー！
世界平和のためだから、箪笥の中身よこせ！
家の中の壺もわらせろー！（笑）

@maplevit まあね～。
ただ、こう思えるのは、いくらイライラしてたりしてもまだ自分には余裕があるのかもしれないとも思ったりする。でも僕はみんなの幸せに良いねして行きたい！

そういうわけで、メイプルさん、フォロワー爆増おめでとう🥰　（めでたいのか？）

@qwalker20200607 そうだねぇ。。ほんとそれか、週末に家族と別行動で観に行くしかない。
仕事帰りにふわっと行くのが気楽でいいんだけどなぁ。
もうほんといろいろ勘弁してほしい。

@5LdRtryzBiCA5nf 殺す前に飯抜きは酷い！
せめて最後の晩餐は豪華にすべきだ！！w
そういうことじゃ無いか😅

@ng8pV2BDZhQ2dkW それがウチのは、ルビスのは発動しないんだよ。なんでかな？
あっ！持ってないからだ！
あははー。😭

@tomotomo778899 子どもといる時間って、休みなのか仕事なのか、みたいなとこあるもんね。
でもきっと子どもが巣立っていったら寂しくなるんだろうなって思ってる。
でも、無理すると続かないから、家事とか適度にサボるのもだいじだよー。

@tomotomo778899 ともともさん、おはよー！
ありがと😊
アトラスってなんか優しそうなんだよね。

@qwalker20200607 あ、そうなんだ。
じゃ、僕も切れてるんだな。
外でケガしたときはせめて消毒とかちゃんとするようにしようっと。

@elko30666 それっぽく描いてみた。
えるちゃんのコラが強烈すぎて、うまいボケが返せなくて（なぜか毎回ボケようとする）
こういうオシャレ装備欲しいわ。

@qwalker20200607 切り方によるけど、ケガが小さくてもなかなか止まらないときあるよね。
お大事に。。。
そして手にケガしてるとこのご時世不便なのがお店に入るときのアルコール消毒ね。あれしみるのよ。。。

@mimu_walk おぉー！！！
おめでとう！
・・・サマル、しんでるけど😅

@mimu_walk @elko30666 そうなんだよね～。
虹になったら1個Sくれるとかないかなって、妄想してる。
虹のハードル上げて良いから。

@elko30666 逆にそれくらいの代償でできるんかい。大神官すげー🤣
でも予報見ると梅雨ってレベルじゃない大雨みたいだね。
1日くらい世界を救うのはお休みしてもよかろう。
